import { useEffect, useState } from "react"

function NotFound(){
const [arr,setArr]=useState([1,2,3,4,5])

useEffect(()=>{
    setArr(arr.push(6))
},[])

return (
    arr.map(item=>{
        <span>{item}</span>
    })
)
} 
export default NotFound
